import { Suspense } from 'react';
import { BrowserRouter as Router, Routes,Route  } from "react-router-dom";
import {PrivateRoute,PublicRoute} from "./Routes/Routes";
import './Assests/main.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import  secureLocalStorage  from  "react-secure-storage";

function App() {
  let Autentication = false;
  let tokenGet = secureLocalStorage.getItem("user");
  if(tokenGet){
    Autentication = true;
  }
  return (
    <Router>
       <Routes>
       {(Autentication ? PrivateRoute :PublicRoute).map((route, index) => {
        return (
          <Route
            key={index}
            path={route.path}
            exact={route.exact}
            element={                  
              <Suspense fallback={<>...</>}>                   
              <route.element/>                  
              </Suspense>                
              }
          />
        );
      })}
    </Routes>
   </Router>
  );
}

export default App;
